import { Router } from "express";
import { authenticate } from "../middleware/common/auth";
const router = Router();
router.get("/my-wallet", authenticate, (req, res) => {
    const userId = req.userId;
    res.json({
        message: `Fetching wallet for user ${userId}`,
    });
});
export default router;
